import React from 'react';

let CurrentRentItem = (props) => {
    const {id,title,beds,days,price} = props
    return <div>
        <p className='text'>{title}</p>
        <span>{beds}</span>
        <span>{days}</span>
        <span>{price}</span>
    </div>
}

export default CurrentRentItem;
